"use client";
import React, { useState } from "react";
import { FaEye, FaEyeSlash, FaKey } from "react-icons/fa";

const ChangePasswordPage = () => {
  const [currentPassword, setCurrentPassword] = useState("");
  const [newPassword, setNewPassword] = useState("");
  const [confirmNewPassword, setConfirmNewPassword] = useState("");

  const [showCurrent, setShowCurrent] = useState(false);
  const [showNew, setShowNew] = useState(false);
  const [showConfirm, setShowConfirm] = useState(false);

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log("Password changed");
  };

  return (
    <div className="d-flex justify-content-center align-items-center vh-100" style={{ background: "#f3f4f6" }}>
      <div className="bg-white p-5 rounded-4 shadow-sm" style={{ width: "100%", maxWidth: "420px" }}>
        <div className="text-center mb-4">
          <FaKey size={42} className="text-dark mb-2" />
          <h4 className="fw-bold text-primary">Change Password</h4>
        </div>

        <form onSubmit={handleSubmit} className="d-flex flex-column gap-4">
          {/* Current Password */}
          <div className="position-relative">
            <label className="form-label">Current Password</label>
            <input
              type={showCurrent ? "text" : "password"}
              className="form-control bg-light border-0 rounded-pill py-3 ps-4 pe-5"
              value={currentPassword}
              onChange={(e) => setCurrentPassword(e.target.value)}
              required
            />
            <span
              className="position-absolute"
              style={{
                top: "50%",
                right: "18px",
                transform: "translateY(-50%)",
                cursor: "pointer",
                color: "#6c757d"
              }}
              onClick={() => setShowCurrent(!showCurrent)}
            >
              {showCurrent ? <FaEyeSlash /> : <FaEye />}
            </span>
          </div>

          {/* New Password */}
          <div className="position-relative">
            <label className="form-label">New Password</label>
            <input
              type={showNew ? "text" : "password"}
              className="form-control bg-light border-0 rounded-pill py-3 ps-4 pe-5"
              value={newPassword}
              onChange={(e) => setNewPassword(e.target.value)}
              required
            />
            <span
              className="position-absolute"
              style={{
                top: "50%",
                right: "18px",
                transform: "translateY(-50%)",
                cursor: "pointer",
                color: "#6c757d"
              }}
              onClick={() => setShowNew(!showNew)}
            >
              {showNew ? <FaEyeSlash /> : <FaEye />}
            </span>
          </div>

          {/* Confirm Password */}
          <div className="position-relative">
            <label className="form-label">Confirm New Password</label>
            <input
              type={showConfirm ? "text" : "password"}
              className="form-control bg-light border-0 rounded-pill py-3 ps-4 pe-5"
              value={confirmNewPassword}
              onChange={(e) => setConfirmNewPassword(e.target.value)}
              required
            />
            <span
              className="position-absolute"
              style={{
                top: "50%",
                right: "18px",
                transform: "translateY(-50%)",
                cursor: "pointer",
                color: "#6c757d"
              }}
              onClick={() => setShowConfirm(!showConfirm)}
            >
              {showConfirm ? <FaEyeSlash /> : <FaEye />}
            </span>
          </div>

          <button type="submit" className="btn btn-success rounded-pill py-2 mt-2 fw-semibold">
            Save
          </button>
        </form>
      </div>
    </div>
  );
};

export default ChangePasswordPage;
